import React from 'react';
import EditInvoiceModal from './EditInvoiceModal';
import '../App.css'

export default function InvoiceCard({}) {
  console.log(props.invoice)
  return (
    <div className="invoice-card-container">
      <ul className="invoice-card-list">
        <li>Name: {props.invoice.name}</li>
        <li>Email: {props.invoice.email}</li>
        <li>Due Date: {props.invoice.due_date.split('T')[0]}</li>
        <li>Total: {props.invoice.total}</li>
      </ul>
      <div className="edit-button-container">
        <EditInvoiceModal 
          invoice={props.invoice}
        />
      </div>
    </div>
  )
}
